import React from "react";

// Componente: FiveCircleVenn
// Uso: import FiveCircleVenn from './FiveCircleVenn'
// <FiveCircleVenn size={600} labels={["A","B","C","D","E"]} />

export default function FiveCircleVenn({
        size = 800,
        labels = ["A", "B", "C", "D", "E"],
        colors = [
            "#ef4444", // red-500
            "#f59e0b", // amber-500
            "#10b981", // emerald-500
            "#3b82f6", // blue-500
            "#8b5cf6", // violet-500
        ],
        showLabels = true,
        }) {
  const r = size * 0.2; // radio de cada círculo
  const cx = size / 2;
  const cy = size / 2;

  // Posiciones en un pentágono para cinco círculos
  const angleOffset = -Math.PI / 2; // para empezar hacia arriba
  const radiusFromCenter = size * 0.05;

  const positions = Array.from({ length: 5 }).map((_, i) => {
    const a = (i * (2 * Math.PI)) / 5 + angleOffset;
    return {
      x: cx + Math.cos(a) * radiusFromCenter,
      y: cy + Math.sin(a) * radiusFromCenter,
    };
  });

  return (
    <div className="p-4 max-w-full flex flex-col items-center gap-4">
      <div className="w-full flex justify-center">
        <svg
          viewBox={`0 0 ${size} ${size}`}
          width={size}
          height={size}
          className="shadow-2xl rounded-2xl bg-white"
          role="img"
          aria-label="Diagrama de Venn de 5 círculos"
        >
          <defs>
            {/* definición de mezcla para un borde sutil */}
            <filter id="soft" x="-50%" y="-50%" width="200%" height="200%">
              <feGaussianBlur stdDeviation="0.7" />
            </filter>
          </defs>

          {/* círculos (dibujados primero para que las intersecciones se muestren por encima) */}
          {positions.map((p, i) => (
            <g key={i} className="group">
              <circle
                cx={p.x}
                cy={p.y}
                r={r}
                fill={colors[i % colors.length]}
                fillOpacity={1}
                stroke="rgba(0,0,0,0.06)"
                strokeWidth={2}
                style={{ mixBlendMode: "multiply" }}
              />

              {/* pequeño anillo exterior para foco */}
              <circle
                cx={p.x}
                cy={p.y}
                r={r}
                fill="none"
                stroke="rgba(0,0,0,0.06)"
                strokeWidth={1}
                filter="url(#soft)"
              />

              {/* etiqueta del círculo */}
              {showLabels && (
                <text
                  x={p.x}
                  y={p.y - r - 8}
                  textAnchor="middle"
                  fontSize={size * 0.035}
                  fontWeight={600}
                  fill="#111827"
                  className="pointer-events-none"
                >
                  {labels[i]}
                </text>
              )}

              {/* tooltip accesible al pasar el ratón */}
              <title>{`Conjunto ${labels[i]}`}</title>
            </g>
          ))}

          {/* centro — etiqueta que indica la intersección general */}
          <g>
            <circle
              cx={cx}
              cy={cy}
              r={size * 0.06}
              fill="transparent"
              stroke="rgba(0,0,0,0.06)"
            />
            <text
              x={cx}
              y={cy}
              textAnchor="middle"
              alignmentBaseline="middle"
              fontSize={size * 0.035}
              fontWeight={700}
              fill="#111827"
            >
              {"A∩B∩C∩D∩E"}
            </text>
          </g>
        </svg>
      </div>

      <div className="w-full max-w-xl text-sm text-gray-600">
        <p>
          Este componente dibuja cinco círculos solapados (posicionados como un
          pentágono) usando <code>SVG</code> y <code>mixBlendMode: 'multiply'</code>
          para mostrar las intersecciones de forma visual. Puedes personalizar
          tamaño, etiquetas y colores vía props.
        </p>

        <div className="mt-3 grid grid-cols-1 sm:grid-cols-2 gap-2">
          <div>
            <strong>Props</strong>
            <ul className="list-disc list-inside">
              <li><code>size</code>: tamaño (px) del canvas SVG. Por defecto 600.</li>
              <li><code>labels</code>: array de 5 etiquetas para cada círculo.</li>
              <li><code>colors</code>: array de 5 colores hex para los círculos.</li>
              <li><code>showLabels</code>: muestra/oculta etiquetas encima de cada círculo.</li>
            </ul>
          </div>

          <div>
            <strong>Uso rápido</strong>
            <pre className="whitespace-pre-wrap bg-gray-50 p-2 rounded">
{`import FiveCircleVenn from './FiveCircleVenn'

<FiveCircleVenn
  size={500}
  labels={["X","Y","Z","U","V"]}
  colors={["#dc2626","#f97316","#059669","#3b82f6","#7c3aed"]}
/>`}
            </pre>
          </div>
        </div>
      </div>
    </div>
  );
}
